import React,{Component} from 'react'


class Uxui extends Component 
{

    render()
    {
        return (<>

            <div className="container-fluid m-2 p-2">
                <img src="https://i.pinimg.com/736x/ce/f3/65/cef3658f078b94360e6fc2032311ba4f.jpg" 
                className="w-100 h-500" />
            </div>

        </>)
    }

}


export default Uxui;
